  summary: "\nAggregation plugin: Extract a date part, specified as a modifier\n"
  remarks: "\nThis aggregator produces no aggregated value; instead it returns modified\ndetail rows. The return value is an integer, the specified part of the date\nthat is the incoming item.\n<table><thead><tr><th>Modifier</th><th>What you get</th></tr></thead><tbody><tr><td>Year</td><td>4-digit year</td></tr><tr><td>Quarter</td><td>Single-digit quarter, starting at 1</td></tr><tr><td>Month</td><td>2-digit month</td></tr><tr><td>Day</td><td>2-digit day of month</td></tr><tr><td>DayOfYear</td><td>Day of year, 1-366</td></tr><tr><td>DayOfWeek</td><td>Day of week, 0=Sunday, 6=Saturday</td></tr><tr><td>Hour</td><td>2-digit 24h-hour</td></tr><tr><td>Weekno</td><td>Week number</td></tr><tr><td>YearMonth</td><td>4-digit year slash 2-digit month</td></tr><tr><td>YearWeekno</td><td>4-digit year slash 2-digit week number</td></tr><tr><td>YearQuarter</td><td>4-digit year slash single-digit quarter number</td></tr></tbody></table>\n"
  syntax:
    content: >-
      [AggregationPlugin("DatePart")]

      public class DatePartAggregation : AggregationPluginBase, IAggregationScalarPlugin, IAggregationPlugin, IPlugin
    content.vb: >-
      <AggregationPlugin("DatePart")>

      Public Class DatePartAggregation
          Inherits AggregationPluginBase
          Implements IAggregationScalarPlugin, IAggregationPlugin, IPlugin
